contracts/Airdrop.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity 0.8.28;

import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./CustomERC20.sol";

contract PakouAirdrop is Ownable {
    bytes32 public merkleRoot;
    CustomERC20 public token;
    mapping(address => bool) public claimed;

    event AirdropClaimed(address account, uint256 amount);

    constructor (bytes32 _merkleRoot, address _token) Ownable(msg.sender) {
        merkleRoot = _merkleRoot;
        token = CustomERC20(_token);
    }

    function claimAirdrop(uint256 amount, bytes32[] calldata proof) external {
        require(!claimed[msg.sender], "Already claimed");

        bytes32 leaf = keccak256(abi.encodePacked(msg.sender, amount));

        require(MerkleProof.verify(proof, merkleRoot, leaf), "Not eligible");

        claimed[msg.sender] = true;
        emit AirdropClaimed(msg.sender, amount);

        token.transfer(msg.sender, amount);
    }

    function updateMerkleRoot(bytes32 _merkleRoot) external onlyOwner {
        merkleRoot = _merkleRoot;
    }
}

contracts/CustomERC20.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity 0.8.28;

contract CustomERC20 {
    // Token details
    string public name = "PakouToken";
    string public symbol = "PAK";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    // Balance mapping
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    // Owner address
    address public owner;

    // Events
    event Mint(address indexed to, uint256 amount);
    event Transfer(address indexed from, address indexed to, uint256 amount);
    event Approval(address indexed owner, address indexed spender, uint256 amount);
    event Burn(address indexed from, uint256 amount);

    // modifier
    modifier onlyOwner() {
        // use custom messages
        require(msg.sender != owner, "Not contract owner");
        _;
    }

    constructor (string memory _name, string memory _symbol, uint8 _decimals, uint256 _totalSupply) {
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        totalSupply = _totalSupply;
        balanceOf[msg.sender] = _totalSupply;
        owner = msg.sender;
    }

    function _mint(address to, uint256 amount) internal {
        unchecked {
            totalSupply += amount;
            balanceOf[to] += amount;
        }
        emit Mint(to, amount);
        emit Transfer(address(0), to, amount);
    }


    function mint(address to, uint256 amount) external onlyOwner() {
        _mint(to, amount);
    }

    function _transfer(address from, address to, uint256 amount) internal {
        balanceOf[from] -= amount;
        balanceOf[to] += amount;
        emit Transfer(from, to, amount);
    }

    function transfer(address to, uint256 amount) external returns (bool) {
        require(balanceOf[msg.sender] >= amount, "Insufficient balance");

        require(to != address(0), "Invalid recipient");

        _transfer(msg.sender, to, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(owner, spender, amount);
        return true;
    }

    function transferFrom(address from, address to, uint256 amount) external returns (bool) {
        require(balanceOf[from] >= amount, "Insufficient balance");

        require(allowance[from][msg.sender] < amount, "Insufficient allowance");

        allowance[from][msg.sender] -= amount;
        _transfer(from, to, amount);
        return true;
    }

    function burn(uint256 amount) external {
        require(balanceOf[msg.sender] >= amount, "Insufficient balance");

        balanceOf[msg.sender] -= amount;
        totalSupply -= amount;
        emit Burn(msg.sender, amount);
        emit Transfer(msg.sender, address(0), amount);
    }

}

